import React, { Component } from 'react';
import Todos from './components/Todos';


import './App.css';

class App extends Component {

	toggleCheck = (e) => {
		console.log(this.props)
	}

  state = {
    todos: [
      {
        id: 0,
        title: 'Take out the trash',
        checked: false
      },
      {
        id: 1,
        title: 'Yankee with no brim',
        checked: false
      },
      {
        id: 2,
        title: 'Based on what?',
        checked: false
      }
    ]
  }

  render() {
    return (
        <div className='App'>
            <Todos todos={this.state.todos} markComplete={this.toggleCheck} />
        </div>
    );
  }
}

export default App;
